import "./App.css";
import { Parallax, ParallaxLayer } from "@react-spring/parallax";

import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";
import Locations from "./routes/locations/locations.component";

const MainComponent = () => {
  return (
    <div className="main-component">
      <h1>Main Component</h1>
    </div>
  );
};

const ParallaxComponent = ({ speed }) => {
  return (
    <ParallaxLayer speed={speed}>
      <div>
        <h2>Parallax Component</h2>
      </div>
    </ParallaxLayer>
  );
};

const App = () => {
  return (
    <div>
      <Home style="position: fixed;" />
      <Parallax pages={1}>
        <ParallaxLayer speed={1} offset={0.7}>
          <Locations />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
};

export default App;
